const navbarStyles = {
	backgroundColor: "#333",
	color: "white",
	display: "flex",
	justifyContent: "space-between",
	alignItem: "center",
	gap: "2rem",
	padding: "0 1rem"
};

const ulStyles = {
	padding: 0,
	margin: 0,
	listStyle: "none",
	"&:hover": {
		backgroundColor: "white"
	}
}

const navLinkStyles = {
	color: "inherit",	
}

function Navbar() {
  return (
    <nav style={navbarStyles}>
			<ul style={ulStyles}>
				<li>
					<a href="/our_story" style={navLinkStyles}>Our Story</a>
				</li>
				<li>
					<a href="/experience" style={navLinkStyles}>The experience</a>
				</li>
				<li>
					<a href="/rsvp" style={navLinkStyles}>RSVP</a>
				</li>
			</ul>
    </nav>
  )
}

export default Navbar
